import React, { useState, useEffect } from 'react';
import {
  Container,
  Paper,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Button,
  Chip,
  IconButton,
  Box,
} from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import { storageService, Request, Employee } from '../services/storageService';
import RequestDialog from '../components/RequestDialog';

const Requests = () => {
  const [requests, setRequests] = useState<Request[]>([]);
  const [employees, setEmployees] = useState<Employee[]>([]);
  const [dialogOpen, setDialogOpen] = useState(false);
  const [selectedRequest, setSelectedRequest] = useState<Request | undefined>();
  const [dialogMode, setDialogMode] = useState<'add' | 'edit'>('add');

  useEffect(() => {
    loadData();
  }, []);

  const loadData = () => {
    setRequests(storageService.getRequests());
    setEmployees(storageService.getEmployees());
  };

  const handleAddClick = () => {
    setSelectedRequest(undefined);
    setDialogMode('add');
    setDialogOpen(true);
  };

  const handleEditClick = (request: Request) => {
    setSelectedRequest(request);
    setDialogMode('edit');
    setDialogOpen(true);
  };

  const handleDeleteClick = (request: Request) => {
    storageService.deleteRequest(request.id);
    loadData();
  };

  const handleDialogClose = () => {
    setDialogOpen(false);
    setSelectedRequest(undefined);
  };

  const handleSaveRequest = (request: Request) => {
    if (dialogMode === 'add') {
      storageService.addRequest(request);
    } else {
      storageService.updateRequest(request);
    }
    loadData();
  };

  const getEmployeeName = (employeeId: string) => {
    const employee = employees.find(emp => emp.id === employeeId);
    return employee ? `${employee.position} (${employee.account})` : employeeId;
  };

  const formatItems = (items: Request['items']) => {
    return items.map(item => `${item.name} x ${item.quantity}`).join(', ');
  };

  const getStatusColor = (status: string) => {
    switch (status) {
      case 'Approved':
        return 'success';
      case 'Disapproved':
        return 'error';
      default:
        return 'warning';
    }
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Paper sx={{ p: 2 }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
          <Typography variant="h6">
            REQUESTS
          </Typography>
          <Button
            variant="contained"
            color="primary"
            onClick={handleAddClick}
          >
            Add Request
          </Button>
        </Box>
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Type</TableCell>
                <TableCell>Employee</TableCell>
                <TableCell>Description</TableCell>
                <TableCell>Request Date</TableCell>
                <TableCell>Items</TableCell>
                <TableCell>Status</TableCell>
                <TableCell>Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {requests.map((request) => (
                <TableRow key={request.id}>
                  <TableCell>{request.type}</TableCell>
                  <TableCell>{getEmployeeName(request.employeeId)}</TableCell>
                  <TableCell>{request.description}</TableCell>
                  <TableCell>{request.requestDate}</TableCell>
                  <TableCell>{formatItems(request.items)}</TableCell>
                  <TableCell>
                    <Chip
                      label={request.status}
                      color={getStatusColor(request.status)}
                    />
                  </TableCell>
                  <TableCell>
                    {request.status === 'Pending' && (
                      <Box>
                        <IconButton
                          size="small"
                          onClick={() => handleEditClick(request)}
                          color="primary"
                        >
                          <EditIcon />
                        </IconButton>
                        <IconButton
                          size="small"
                          onClick={() => handleDeleteClick(request)}
                          color="error"
                        >
                          <DeleteIcon />
                        </IconButton>
                      </Box>
                    )}
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Paper>

      <RequestDialog
        open={dialogOpen}
        onClose={handleDialogClose}
        onSave={handleSaveRequest}
        request={selectedRequest}
        mode={dialogMode}
        employees={employees}
        nextRequestId={storageService.getNextRequestId()}
      />
    </Container>
  );
};

export default Requests;
